var myHeaders = new Headers();
myHeaders.append("Access-Control-Allow-Origin", "http://localhost:3000");
myHeaders.append("Content-Type", undefined);
export const getEvents = (location) => fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location="+location, {
    method: "GET",
    cors: "cors"
}).then((res) => {
    return res;
});
